import React from 'react';
import ReactDom from 'react-dom';
import '../css/App.css';

function Navegation(props){
    const loggin = props.loggin;
    if (loggin){
        return(
            <div> Inrego Logeado </div>
        )
    }
    return(
        <div> Ingreso Deslogeado</div>
    )

}    

ReactDom.render(
    <Navegation isLoggedIn={true} />,
    document.getElementById('root')
)

module.exports = Navegation();
